import React from "react";

import Header from "../../components/header";
import "./style.scss";

function Privacy() {
  return (
    <>
      <Header></Header>
      <div className="page app-container">
        <div className="page-title">Privacy and Cookies Statement</div>
        <p>
          Instafashion LTD Company number 12159054 operates Fashone.com internet
          platform are committed to protecting and respecting your privacy.
        </p>
        <p>
          This privacy statement (together with our terms and conditions and any
          other policies referred to in it) explains what information we gather
          about you, what and how we use that information, the lawful basis on
          which that information is used and who we give that information to. It
          also sets out your rights and our obligations in relation to your
          information and who you can contact for more information or queries
        </p>
      </div>
    </>
  );
}

export default Privacy;
